import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Box from "./components/Box";

function App() {
  const arr = [1, 2, 3];
  return (
    <div className="App">
      <div className="wrapper">
        {arr.map((x) => (
          <Box />
        ))}
      </div>
    </div>
  );
}

export default App;
